import React from 'react';

const Header = () => {
  return (
    <div>
      <header>
        <h1>Admin Panel</h1>
        <nav>
          <a href="/">Home</a> | <a href="/employee-list">Employee List</a> | {username} - <button onClick={handleLogout}>Logout</button>
        </nav>
      </header>
      </div>
  )
}

export default Header;
